import React from "react";
import Table from 'react-bootstrap/Table';

const Province = ({ name, confirmed, recovered, active, deaths }) => {
  return (
    <div className="Province">
        <Table responsive striped bordered hover variant="dark">
            <thead>
                <tr>
                    <th>Province</th>
                    <th>Confirmed</th>
                    <th>Recovered</th>
                    <th>Active</th>
                    <th>Deaths</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>{name}</td>
                    <td>{confirmed}</td>
                    <td>{recovered}</td>
                    <td>{active}</td>
                    <td>{deaths}</td>
                </tr>
            </tbody>
        </Table>
    </div>
  );
};

export default Province;
